w.cairns.qld.gov.au/include/IA/index_pages/lawsRegPermits/localLawsPolicies.html\">Local Law</a>.</p>\n<p align=\"left\"><b>Discount registration and renewal fees cease on 1 August each year. </b></p>\n<p align=\"left\">Council offers a variety of convenient methods to <b>pay </b>your annual renewal fee:</p>\n<ul>\n  <li><a href=\"https://eservices.cairns.qld.gov.au/eservice/start.do\">Online at our secure site</a></li>\n  <li> in person at Council\'s Customer Service Centres at Spence Street, Cairns and Front Street, Mossman \n   or at our libraries in Earlville, Smithfield, Gordonvale, Babinda and Mossman</li>\n\n  <li>Post a cheque or money order to Cairns Regional Council, PO Box 359 Cairns 4870</li>\n  <li>Pay in person at any post office, by phoning 13 18 16 or go to postbillpay.com.au </li>\n</ul>\n<p align=\"left\">For further information on registration charges, please phone Customer Service on 4044 3044.</p>\n<ul>\n  <li><a href=\"http://www.cairns.qld.gov.au/content/animalMgmt/files/dog_registration.pdf\" align=\"left\">Dog Registration Form</a></li>\n  <li><a href=\"http://www.cairns.qld.gov.au/content/animalMgmt/files/lifetime_registration.pdf\">Lifetime Registration Form</a></li>\n</ul>\n\n<p align=\"left\">In the interest of responsible dog ownership and to limit the number of unwanted animals, and to assist with unregistered back yard breeding laws, the registration fee for a desexed dog is substantially less than that for an entire dog. Proof of desexing is required, either by suppling a copy of the desexing certificate, or a written letter from your vet.</p>\n<p align=\"left\"><b>Discounted registration fees</b></p>\n<p align=\"left\">Are also provided to pensioners, and for dogs which have achieved Level Three obedience training from a recognised school. Proof of eligility is required.</p>\n<p><b>Lifetime Registration for Dogs</b></p>\n<p>Is available for Aged Pensioner Concession Card or other Pensioner Concession Card holders who would otherwise be eligible for the Aged Pension.** Pensioner concession card holders must be at least 60 years of age**<strong> </strong>All  dogs MUST be desexed and microchipped to be eligible. Copies of relevant documentation must be provided along with the application to qualify. </p>\n<p align=\"left\">Registering your dog helps Council reunite your pet if it is impounded, or to notify you in case of an accident.&nbsp; </p>\n<p align=\"left\">Registration fees also enable Council to deliver a wide range of Animal Management programs and services, such as the Pound, dog patrols and community information about responsible pet ownership. </p>','<?xml version=\"1.0\" encoding=\"UTF-8\" standalone=\"yes\"?>\n<ns2:CanonicalProcess xmlns:ns2=\"http://www.apromore.org/CPF\" name=\"Pet registration Cairns\">\n    <Net id=\"1281492481759\">\n        <Node xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:type=\"ns2:EventType\" id=\"1281492481760\">\n            <resourceTypeRef resourceTypeId=\"1281492481758\"/>\n        </Node>\n        <Node xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:type=\"ns2:TaskType\" id=\"1281492481761\">\n            <name>Give details</name>\n            <resourceTypeRef resourceTypeId=\"1281492481758\"/>\n        </Node>\n        <Node xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:type=\"ns2:XORJoinType\" id=\"1281492481762\"/>\n        <Node xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:type=\"ns2:TaskType\" id=\"1281492481763\">\n            <name>Download\nform</name>\n            <resourceTypeRef resourceTypeId=\"1281492481758\"/>\n        </Node>\n        <Node xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:type=\"ns2:TaskType\" id=\"1281492481764\">\n            <name>Mail form\nand payment</name>\n            <resourceTypeRef resourceTypeId=\"1281492481758\"/>\n        </Node>\n        <Node xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\" xsi:type=\"ns2:TaskType\" id=\"1281492